                    </div>
                    <div className="pl5box box2 row">
                        <div className="boxI boxI2"></div>
                        <div className="lp5mmaintitle">با بهترین امکانات مشاوره ای</div>
                        <div className="lp5matn">با تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید کرد تا برنامه منظم برای پیشرفت شما سازمان دهی  کنندبا تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید کرد تا برنامه منظم برای پیشرفت شما سازمان دهی  کنند</div>
                    </div>
                    <div className="pl5box box3 row">
                        <div className="boxI boxI3"></div>
                        <div className="lp5mmaintitle">  کار فیزیکی حداقل </div>
                        <div className="lp5matn">با تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید کرد تا برنامه منظم برای پیشرفت شما سازمان دهی  کنندبا تیم کنکور به بهترین مشاور های درسی و برترین های کشور دسترسی پیدا خواهید کرد تا برنامه منظم برای پیشرفت شما سازمان دهی  کنند</div>
                    </div>


                </div>
                <div className="lp5pic col-2 col-xl-5"></div>
            </div>
         );
    }
}

